import { NavLink } from 'react-router-dom';
import s from './Header.module.css';

const Header = (props) => {
    return ( 
        <div>
            <h1 className={s.h1}>UsiChat</h1>
            <div className={s.loginBlock}>
                {props.idAuth ? props.login :<NavLink to='/login'>{}</NavLink>}
                
            </div>
        </div>
    )
}
export default Header;
